(167, 12, '_about_heading', 'field_5d6021e0186f0'),
(168, 12, 'section_one_right_text_one', '<p class=\"intro_para-two\">Whether you are first-time home owner, to savvy real estate investor, <span class=\"text_brown\">we are here assist you by empowering you with the right information, service and process.</span></p>\r\n<p class=\"intro_para-two\">We work alongside the woman who hasn\'t bought her first investment property, the woman already killing it in real estate, and the woman in between.</p>'),
(169, 12, '_section_one_right_text_one', 'field_5d6021f0186f1'),
(170, 12, 'section_one_right_text_two', 'No two women are the same, and each has their own vision for what they want in life. This is why we established a real estate boutique that <span class=\"text_brown\">builds strong connections with clients and develops an in-depth understanding of what drives them and where they see themselves</span> in the near and distant future.'),
(171, 12, '_section_one_right_text_two', 'field_5d6022ba186f2'),
