(176, 12, 'section_two_heading', 'No two women are the same, and each has their own vision for what they want in life.'),
(1694, 375, 'about_heading', 'Her Castle <span class=\"text_black\"> is a place where you can find all the information you need about residential real estate in the Greater Toronto Area.</span> '),
(177, 12, '_section_two_heading', 'field_5d6022ff186f5'),
(178, 12, 'section_two_text_middle', ' <p class=\" text-left-sm intro_para-two\">This is why we established a real estate boutique that builds strong connections with clients and develops an in-depth understanding of what drives them and where they see themselves in the near and distant future.\r\n</p>\r\n<p  class=\"intro_para \">Although we work alongside women of all experience levels to buy, rent, and sell property, we emphasize supporting first-time buyers in building the confidence to find the right home without compromise. As mentors, we empower our clients to make quantum leaps in wealth acquisition, sharing trade secrets to propel investment value.</p>'),
(179, 12, '_section_two_text_middle', 'field_5d602328186f6'),
(180, 12, 'section_two_left_text', 'A recognized communicator, you will find us listening to your clients\' wants, values, and needs, as we take the time to understand the \"why\'s\" and benefits of their next real estate move.'),
(709, 196, 'about_heading', '<span class=\"text_brown\">Her Castle</span> is a place where you can find all the information you need about residential real estate in the Greater Toronto Area.'),
(181, 12, '_section_two_left_text', 'field_5d602349186f7'),
(182, 12, 'section_three_heading_one', '<span class=\"text_brown\">We support and are supported by women just like you, </span><span class=\"text_black\">and we help others make quantum leaps in their wealth and career</span>'),
