(301, 120, '_edit_lock', '1573319359:1'),
(302, 120, '_wp_page_template', 'template-resource-buyer-guide.php'),
(303, 122, '_edit_last', '1'),
(304, 122, '_edit_lock', '1566613536:1'),
(305, 120, 'section_one_heading_one', 'Benefits of home ownership'),
(306, 120, '_section_one_heading_one', 'field_5d60a0851b5c9'),
(307, 120, 'section_one_heading_two', 'Investment'),
(308, 120, '_section_one_heading_two', 'field_5d60a0971b5ca'),
(309, 120, 'section_one_text', 'For most homeowners, their residence is their largest asset. With 20% or more equity invested in your home, as is typical in NYC, your home is a major investment. As you live in and make improvements to your home, and gradually pay down the principal on your mortgage, you are building on this equity.'),
(310, 120, '_section_one_text', 'field_5d60a09e1b5cb'),
(311, 120, 'section_two_heading_one', 'Top 5 tips for buyers'),
(312, 120, '_section_two_heading_one', 'field_5d60a0b71b5cc'),
(313, 120, 'section_two_heading_two', 'There are five crucial rules to follow as you embark on the purchase of a property:'),
(314, 120, '_section_two_heading_two', 'field_5d60a0c61b5cd'),
(315, 120, 'section_two_text', '<li>Choose a real estate agent carefully as this person will be the most important advisor in your search. You will spend considerable time with this person so, in addition to knowledge and experience, trust and fit are key qualities you should seek. </li>\r\n<li>Before you begin searching for your property, get pre-approved for a mortgage with a bank and/or a mortgage broker so you have a clear understanding of your budget. Your real estate agent can provide recommendations of trusted lender contacts.</li> \r\n<li>Educate yourself on the market by speaking with your real estate agent about property values in different neighborhoods and the differences between cooperatives and condominiums. </li>\r\n<li>Take advantage of publicly available information to research recent sales of comparable properties, and visit open houses in addition to those properties introduced by your real estate agent to get up to speed on the current market. </li>\r\n<li>Once you find a home you are interested in be sure to do your due diligence. Your real estate agent will help you obtain information about the building’s financial condition as well as any renovation or major repairs that may have been done to the property itself and the building. Building policies on financing, pied à terre and subletting vary considerably, and can affect property values. </li>\r\n<li>Build out your team wisely. New York is an attorney state so you will need to hire a New York City real estate attorney to represent you in the purchase. Your real estate agent will provide recommendations of competent, experienced attorneys from whom you can choose.</li>'),
(316, 120, '_section_two_text', 'field_5d60a0ce1b5ce'),
(317, 129, 'section_one_heading_one', 'Benefits of home ownership'),
