(462, 182, '_top_heading', 'field_5d5c1ec7d4414'),
(463, 182, 'left_text_one', 'Whether you are first-time home owner, to savvy real estate investor, <span class=\"text_brown font-weight-bold\">we are here assist you by empowering you with the right information, service and process.</span>'),
