(559, 191, 'about_heading', '<span class=\"text_brown\">Her Castle</span> is a place where you can find all the information you need about residential real estate in the Greater Toronto Area.'),
(589, 192, 'about_heading', '<span class=\"text_brown\">Her Castle</span> is a place where you can find all the information you need about residential real estate in the Greater Toronto Area.'),
(590, 192, '_about_heading', 'field_5d6021e0186f0'),
(619, 193, 'about_heading', '<span class=\"text_brown\">Her Castle</span> is a place where you can find all the information you need about residential real estate in the Greater Toronto Area.'),
(649, 194, 'about_heading', '<span class=\"text_brown\">Her Castle</span> is a place where you can find all the information you need about residential real estate in the Greater Toronto Area.'),
(469, 186, 'about_heading', '<span class=\"text_brown\"> Her Castle, a culmination of compassion and expertise, creates tailored marketing approaches and guidance for clients in search of proven real estate solutions. </span>'),
(470, 186, '_about_heading', 'field_5d6021e0186f0'),
(471, 186, 'section_one_right_text_one', 'With more women making financial investments than ever before, <span class=\"text_brown\"> we take pride in formally introducing them to the exciting and lucrative world of real estate </span>. We place comfort and confidentiality at the forefront of each interaction, ensuring that clients receive <span class=\"text_brown\"> real estate advice to meet their needs </span> while remaining sensitive to the stresses that arise from buying and selling homes.'),
(472, 186, '_section_one_right_text_one', 'field_5d6021f0186f1'),
(473, 186, 'section_one_right_text_two', 'No two women are the same, and each has their own vision for what\r\nthey want in life. This is why we established a real estate boutique that <span class=\"text_brown\"> builds strong connections with clients and develops an in-depth understanding of what drives them and where they see themselves </span> in the near and distant future.'),
(474, 186, '_section_one_right_text_two', 'field_5d6022ba186f2'),
(475, 186, 'section_one_left_image_one', '102'),
(476, 186, '_section_one_left_image_one', 'field_5d6022cb186f3'),
(477, 186, 'section_one_left_image_two', '103'),
(478, 186, '_section_one_left_image_two', 'field_5d6022ee186f4'),
(479, 186, 'section_two_heading', '<span class=\"text_brown\">Her Castle</span> offers much more than just help with buying, renting, and selling properties, we <span class=\"text_brown\"> provide the tools and insight</span> to plan for timely and intelligent investments.'),
(480, 186, '_section_two_heading', 'field_5d6022ff186f5'),
(481, 186, 'section_two_text_middle', 'We empower our clients to make quantum leaps in wealth acquisition, sharing trade secrets to propel investment value.'),
(482, 186, '_section_two_text_middle', 'field_5d602328186f6'),
(483, 186, 'section_two_left_text', ''),
(484, 186, '_section_two_left_text', 'field_5d602349186f7'),
(485, 186, 'section_three_heading_one', 'We work alongside women of <span class=\"text_brown\">all experience levels</span> to buy, rent, and sell property. We emphasise supporting <span class=\"text_brown\">first-time buyers</span> in building the confidence to <span class=\"text_brown\">find the right home</span> without compromise. '),
(486, 186, '_section_three_heading_one', 'field_5d602371186f8'),
(487, 186, 'section_three_image_one', '104'),
(488, 186, '_section_three_image_one', 'field_5d602389186f9'),
(489, 186, 'section_three_image_two', '105'),
(490, 186, '_section_three_image_two', 'field_5d6023a4186fa'),
(491, 186, 'section_three_heading_two', 'We work to support our clients in their busy lives by providing them with their <span class=\"text_brown\">own dedicated lifestyle manager and luxury concierge service.</span>'),
(492, 186, '_section_three_heading_two', 'field_5d6023c2186fb'),
(493, 186, 'contact_section_heading', 'If any of this resonates, then HC is for you.'),
