(983, 205, 'section_one_right_text_two', 'No two women are the same, and each has their own vision for what they want in life. This is why we established a real estate boutique that <span class=\"text_brown\">builds strong connections with clients and develops an in-depth understanding of what drives them and where they see themselves</span> in the near and distant future.'),
