(1696, 375, 'section_one_right_text_one', 'With more women making financial investments than ever before, <span class=\"text_brown\">we take pride in formally introducing them to the exciting and lucrative world of real estate.<span> We place comfort and confidentiality at the forefront of each interaction, ensuring that clients receive <span class=\"text_brown\">real estate advice to meet their needs</span> while remaining sensitive to the stresses that arise from buying and selling homes. '),
(1697, 375, '_section_one_right_text_one', 'field_5d6021f0186f1'),
(1698, 375, 'section_one_right_text_two', 'No two women are the same, and each has their own vision for what they want in life. This is why we established a real estate boutique that <span class=\"text_brown\">builds strong connections with clients and develops an in-depth understanding of what drives them and where they see themselves</span> in the near and distant future.'),
(1699, 375, '_section_one_right_text_two', 'field_5d6022ba186f2'),
