(1792, 380, 'left_section_contact_page', '<h2 class=\"font-weight-bold pb-4\">We\'re available for you 7 days a week. Please, contact us so we can get started.</h2>\r\n<p class=\"fz-18 pt-3\">Call us or mail</p>\r\n<a class=\"btn btn-light px-3 font-weight-bold\" href=\"tel:647-202-4427\"><img class=\"icon-phone\" src=\"http://hercastle.ca/wp-content/themes/hercastle/img/Phone%20Icon.svg\" /> Direct: 647-202-4427</a>\r\n\r\n<a class=\"btn btn-light px-3 font-weight-bold mtop10\" href=\"mailto:Libertad@hercastle.ca\"><img class=\"icon-email\" src=\"http://hercastle.ca/wp-content/themes/hercastle/img/icon-envelop.png\" /> Libertad@hercastle.ca</a>\r\n\r\n&nbsp;\r\n<p class=\"fz-18\">178 Main St Unionville\r\nUnionville, ON L3R 2G9\r\nOffice: 289-846-3707</p>\r\n\r\n<div class=\"pb-4\"><a href=\"https://goo.gl/maps/r5382njesECJRYfD9\"><button class=\"btn btn-light badge-pill px-3 font-weight-bold size15\"><img class=\"alignnone size-full wp-image-225\" src=\"http://hercastle.ca/wp-content/uploads/2019/11/icon-loc.png\" alt=\"\" width=\"20\" height=\"24\" /> Look on Google Maps</button></a></div>'),
