(1905, 12, '_about_libertad_martinez_left_image', 'field_5ddcb078e8085'),
(1906, 12, 'about_libertad_martinez_heading', 'About Libertad Martinez'),
(1907, 12, '_about_libertad_martinez_heading', 'field_5ddcb08de8086'),
(1908, 12, 'about_libertad_martinez_text', '<p class=\"text-left-sm intro_para\">Founder of Her Castle and real estate expert, Libertad Martinez guides women of all backgrounds and walks of life down the path of discovering their ideal property. She offers a unique blend of charisma, patience, and savvy negotiation skills to safeguard real estate financial investments with the utmost integrity and honesty.</p>\r\n<p class=\"text-left-sm intro_para\">Libertad consistently maintains a finger on the pulse of the market, tracking current trends as well as anticipating future changes. She leverages this knowledge and her client-conscientious approach when advising clients on purchasing, renting, and selling property.</p>\r\n<p class=\"text-left-sm intro_para\">Libertad is a firm believer that wellness of the mind, body, and spirit are essential components of achieving success in any endeavor. She works around the clock to satisfy clients but also understands the importance of leading a balanced lifestyle. Her mantra is to work smarter not harder, and she is persistent, patient, thoughtful, and organized.</p>'),
(1909, 12, '_about_libertad_martinez_text', 'field_5ddcb09fe8087'),
