(1950, 391, 'about_libertad_martinez_text', '<p class=\"text-left-sm intro_para\">Founder of Her Castle and real estate expert, Libertad Martinez guides women of all backgrounds and walks of life down the path of discovering their ideal property. She offers a unique blend of charisma, patience, and savvy negotiation skills to safeguard real estate financial investments with the utmost integrity and honesty.</p>\r\n<p class=\"text-left-sm intro_para\">Libertad consistently maintains a finger on the pulse of the market, tracking current trends as well as anticipating future changes. She leverages this knowledge and her client-conscientious approach when advising clients on purchasing, renting, and selling property.</p>\r\n<p class=\"text-left-sm intro_para\">Libertad is a firm believer that wellness of the mind, body, and spirit are essential components of achieving success in any endeavor. She works around the clock to satisfy clients but also understands the importance of leading a balanced lifestyle. Her mantra is to work smarter not harder, and she is persistent, patient, thoughtful, and organized.</p>'),
(1951, 391, '_about_libertad_martinez_text', 'field_5ddcb09fe8087'),
(1952, 12, 'bottom_heading', 'We work to support our clients in their busy lives by providing them with their <span class=\"text_brown\">own dedicated lifestyle manager and luxury concierge service.</span>'),
(1953, 12, '_bottom_heading', 'field_5ddcb191fc93c'),
(1954, 393, 'about_heading', '<span class=\"text_brown\">Her Castle</span> is a place where you can find all the information you need about residential real estate in the Greater Toronto Area.'),
(1955, 393, '_about_heading', 'field_5d6021e0186f0'),
(1956, 393, 'section_one_right_text_one', '<p class=\"intro_para-two\">Whether you are first-time home owner, to savvy real estate investor, <span class=\"text_brown\">we are here assist you by empowering you with the right information, service and process.</span></p>\r\n<p class=\"intro_para-two\">We work alongside the woman who hasn\'t bought her first investment property, the woman already killing it in real estate, and the woman in between.</p>'),
(1957, 393, '_section_one_right_text_one', 'field_5d6021f0186f1'),
(1958, 393, 'section_one_right_text_two', 'No two women are the same, and each has their own vision for what they want in life. This is why we established a real estate boutique that <span class=\"text_brown\">builds strong connections with clients and develops an in-depth understanding of what drives them and where they see themselves</span> in the near and distant future.'),
(1959, 393, '_section_one_right_text_two', 'field_5d6022ba186f2'),
(1960, 393, 'section_one_left_image_one', '382'),
(1961, 393, '_section_one_left_image_one', 'field_5d6022cb186f3'),
(1962, 393, 'section_one_left_image_two', '383'),
(1963, 393, '_section_one_left_image_two', 'field_5d6022ee186f4'),
(1964, 393, 'section_two_heading', 'No two women are the same, and each has their own vision for what they want in life.'),
(1965, 393, '_section_two_heading', 'field_5d6022ff186f5'),
(1966, 393, 'section_two_text_middle', ' <p class=\" text-left-sm intro_para-two\">This is why we established a real estate boutique that builds strong connections with clients and develops an in-depth understanding of what drives them and where they see themselves in the near and distant future.\r\n</p>\r\n<p  class=\"intro_para \">Although we work alongside women of all experience levels to buy, rent, and sell property, we emphasize supporting first-time buyers in building the confidence to find the right home without compromise. As mentors, we empower our clients to make quantum leaps in wealth acquisition, sharing trade secrets to propel investment value.</p>'),
(1967, 393, '_section_two_text_middle', 'field_5d602328186f6'),
(1968, 393, 'section_two_left_text', 'A recognized communicator, you will find us listening to your clients\' wants, values, and needs, as we take the time to understand the \"why\'s\" and benefits of their next real estate move.'),
(1969, 393, '_section_two_left_text', 'field_5d602349186f7'),
(1970, 393, 'section_three_heading_one', '<span class=\"text_brown\">We support and are supported by women just like you, </span><span class=\"text_black\">and we help others make quantum leaps in their wealth and career</span>'),
(1971, 393, '_section_three_heading_one', 'field_5d602371186f8'),
(1972, 393, 'section_three_image_one', '104'),
(1973, 393, '_section_three_image_one', 'field_5d602389186f9'),
(1974, 393, 'section_three_image_two', '105'),
(1975, 393, '_section_three_image_two', 'field_5d6023a4186fa'),
(1976, 393, 'section_three_heading_two', 'We work to support our clients in their busy lives by providing them with their <span class=\"text_brown\">own dedicated lifestyle manager and luxury concierge service.</span>'),
(1977, 393, '_section_three_heading_two', 'field_5d6023c2186fb'),
(1978, 393, 'contact_section_heading', 'If any of this resonates, then HC is for you.'),
(1979, 393, '_contact_section_heading', 'field_5d6023e0186fc'),
(1980, 393, 'contact_section_text', 'We invite you to speak with anyone in our team'),
(1981, 393, '_contact_section_text', 'field_5d6023f2186fd'),
(1982, 393, 'section_one_right_text_one_new', 'Her castle works with a wide range of buyers and sellers, but we distinguish ourselves through <span class=\"text_brown\">our passion to serve and support the growing community of women entering and thriving within the real estate investment market</span>. \r\nOur primary goal is to <span class=\"text_brown\">help our clients gain financial independence</span> and long-term security. Clients include those who want to transition away from renting property, those looking for a fresh start, and those retirees looking for the perfect place to spend their golden years.'),
(1983, 393, '_section_one_right_text_one_new', 'field_5dbcb3766415b'),
(1984, 393, 'our_client_section', 'A recognized communicator, you will find us listening to your clients\' wants, values, and needs, as we take the time to understand the \"why\'s\" and benefits of their next real estate move.'),
(1985, 393, '_our_client_section', 'field_5d602349186f7'),
(1986, 393, 'our_client_heading', 'Our Clients'),
(1987, 393, '_our_client_heading', 'field_5d602349186f7'),
(1988, 393, 'our_client_text', '<p class=\"text-left-sm intro_para\">Her castle works with a wide range of buyers and sellers, but we distinguish ourselves through our passion to serve and support the growing community of women entering and thriving within the real estate investment market. </p>\r\n<p class=\"intro_para\">Our primary goal is to help our clients gain financial independence and long-term security. </p>\r\n<p class=\"intro_para\">Clients include those who want to transition away from renting property, those looking for a fresh start, and those retirees looking for the perfect place to spend their golden years. </p>'),
(1989, 393, '_our_client_text', 'field_5ddcaf3d5d12b'),
(1990, 393, 'about_libertad_martinez_left_image', '390'),
