(281, 1, '2019-11-14 08:55:31', '2019-11-14 08:55:31', 'Libertad was an outstanding agent. As first-time home buyers, there was a lot that my husband and I didn\'t know and were nervous about. Libertad was very patient and took the time to explain various legal and financial matters to us, so that we really understood what was happening. She was always responsive and never kept us waiting. She also made it obvious to us that she really cared about us and wanted what was in our best interest. I would recommend her to anyone who is interested in buying or selling property. She was tenacious and always available. We were extremely glad to have her on our side.', 'Raquel Dasilva', '', 'publish', 'closed', 'closed', '', 'raquel-dasilva', '', '', '2019-11-26 12:54:26', '2019-11-26 12:54:26', '', 0, 'http://hercastle.ca/?post_type=spt_testimonial&#038;p=281', 0, 'spt_testimonial', '', 0),
