(285, 1, '2019-11-14 08:57:01', '2019-11-14 08:57:01', 'Libertad is a very well organized, target oriented individual who get things done right and on time. She was in charge of helping me buy my first condo and has been managing it for me the last few years. As well, she keeps me informed in what is going on in my neighbourhood so I always know the value of my investment property.  She was very helpful and extremely professional.', 'Alicia Henry', '', 'publish', 'closed', 'closed', '', 'alicia-henry', '', '', '2019-11-14 10:27:33', '2019-11-14 10:27:33', '', 0, 'http://hercastle.ca/?post_type=spt_testimonial&#038;p=285', 0, 'spt_testimonial', '', 0),
(286, 1, '2019-11-14 08:57:38', '2019-11-14 08:57:38', 'It is a pleasure to provide a recommendation for Libertad. Her dedication, commitment and loyalty have been truly refreshing. A key attribute that stands out with Libertad is her strong service orientation, sound judgment and her ability to use her interpersonal skills to always work towards a common goal and bring out the best of all us.', 'Maria Herbert', '', 'publish', 'closed', 'closed', '', 'maria-herbert', '', '', '2019-11-14 08:57:38', '2019-11-14 08:57:38', '', 0, 'http://hercastle.ca/?post_type=spt_testimonial&#038;p=286', 0, 'spt_testimonial', '', 0),
(287, 1, '2019-11-14 08:58:32', '2019-11-14 08:58:32', 'Libertad helped us to buy our first home! In addition to having been a client, I\'ve known Libertad in a professional capacity for about ten years. She is always sincere, caring, professional and very knowledgeable about the market.  She was very efficient and considerate of our busy schedule and only saw properties that were perfect for us, never wasting our time. With her help and guidance, we made an excellent investment.', 'Malinda Chohan', '', 'publish', 'closed', 'closed', '', 'malinda-chohan', '', '', '2019-11-14 10:27:12', '2019-11-14 10:27:12', '', 0, 'http://hercastle.ca/?post_type=spt_testimonial&#038;p=287', 0, 'spt_testimonial', '', 0),
