(316, 1, '2019-11-19 15:19:57', '2019-11-19 15:19:57', 'SXSW condos and towns is coming to South Woodbridge at Steeles Ave W and Islington Avenue. This large project will feature both condos and townhomes totaling 848 units. SWSX condos will offer amazing views of the Humber River. Greenspace surrounds the development with plenty of parks and trails to explore.\r\n\r\nSXSW is located just south of HWY 407 and HWY 7 which gives easy access to HWY 400, 401 and 427. TTC regional buses also run within the immediate area. Nearby Higher learning establishments include York University and the Seneca at York Campus.', 'Kingsway & Royal York', '', 'publish', 'closed', 'closed', '', 'kingsway-royal-york', '', '', '2019-11-21 10:56:57', '2019-11-21 10:56:57', '', 0, 'http://hercastle.ca/?post_type=projects&#038;p=316', 0, 'projects', '', 0),
