(325, 1, '2019-11-19 15:52:30', '2019-11-19 15:52:30', '<div class=\"form-group\">\r\n<label class=\"font-weight-bold\">First name</label>\r\n[text* firstname class:form-control class:bg-light class:border-0 class:mb-3]\r\n</div>\r\n<div class=\"form-group\">\r\n<label class=\"font-weight-bold\">Last name</label>\r\n[text* lastname class:form-control class:bg-light class:border-0 class:mb-3]\r\n</div>\r\n<div class=\"form-group\">\r\n<label class=\"font-weight-bold\">Email</label>\r\n[email* email class:form-control class:bg-light class:border-0 class:mb-3]\r\n</div>\r\n<div class=\"form-group\">\r\n<label class=\"font-weight-bold\">Phone</label>\r\n[tel* phone class:form-control class:bg-light class:border-0 class:mb-3]\r\n</div>\r\n<div class=\"form-group\">\r\n<label class=\"font-weight-bold\">Are you a realtor?</label>\r\n<div class=\"form-check\">\r\n[radio realtor use_label_element default:1 \"Yes\" \"No\"]\r\n</div>\r\n</div>\r\n<div class=\"form-group\">\r\n<label class=\"font-weight-bold\">Message <small>(Optional)</small></label>\r\n[text* message class:form-control class:bg-light class:border-0 class:mb-3]\r\n</div>\r\n<div class=\"custom-control custom-checkbox my-1 mr-sm-2\">\r\n[checkbox* checkbox \"I provide consent to receive future electronic messages that contain commercial content from Her Castle.\"]\r\n</div>\r\n[submit class:btn class:font-weight-bold class:text-white class:btn-primary class:border-0 class:btn-block class:mt-3 class:send_request_btn \"Register for More Information\"]\n1\nHercastle New Development Enquiry\nHercastle <contact@hercastle.ca>\nlibertad@hercastle.ca, sushmasaini164@gmail.com\nHello,\r\n\r\nHere is the details form New Development Enquiry.\r\n\r\n<table>\r\n<tr><th style=\"text-align:left;\">Name:</th><td>[firstname] [lastname]</td></tr>\r\n<tr><th style=\"text-align:left;\">Email:</th><td>[email]</td></tr>\r\n<tr><th style=\"text-align:left;\">Phone:</th><td>[phone]</td></tr>\r\n<tr><th style=\"text-align:left;\">Realtor:</th><td>[realtor]</td></tr>\r\n<tr><th style=\"text-align:left;\">Message:</th><td>[message]</td></tr>\r\n</table>\r\n\r\nThanks\nReply-To: [email]\n\n1\n\n\nHercastle \"[your-subject]\"\nHercastle <wordpress@hercastle.ca>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on Hercastle (http://hercastle.ca)\nReply-To: parmod2711@gmail.com\n\n\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.\nThe date format is incorrect.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nThe number format is invalid.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nYour entered code is incorrect.\nThe e-mail address entered is invalid.\nThe URL is invalid.\nThe telephone number is invalid.', 'Project Detail Page Form', '', 'publish', 'closed', 'closed', '', 'project-detail-page-form', '', '', '2019-11-21 18:16:43', '2019-11-21 18:16:43', '', 0, 'http://hercastle.ca/?post_type=wpcf7_contact_form&#038;p=325', 0, 'wpcf7_contact_form', '', 0),
