(346, 1, '2019-11-21 10:04:05', '2019-11-21 10:04:05', '<p>36 Zorra St, Etobicoke, ON\r\n\r\n36 Zorra condos is a new condo development coming to Kipling and The Queensway in Etobicoke. This area has an abundance of entertainment options from local restaurants, cafes and big box stores. The upscale Sherway Gardens mall is minutes away for your shopping therapy needs. Humber College – Lakeshore campus is an approx 5 min bus ride away.\r\nWhat else is great about this area is the convenient highway and transit options. The Gardiner Expressway will take you to downtown Toronto in under 20 mins (sans traffic) and Hwy 427 and 401 are also close by.\r\nEtobicoke provides a great option for new condo development because of the lifestyle it offers, the location of 36 Zorra provides, easy access to Lake Ontario and various parks as well as major airports Pearson and Porter.\r\n\r\n<strong><em>Register here or reply to this email for more information about the pricing and limited time incentives to own at this prime gta location!</em></strong>\r\n</p>\r\n\r\n<p>\r\n<a href=\"http://hercastle.ca/wp-content/uploads/2019/11/Thirty-Six-Zorra-Floorplans.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">CLICK TO DOWNLOAD THE FLOORPLANS </a>\r\n<a href=\"http://hercastle.ca/wp-content/uploads/2019/11/Thirty-Six-Zorra-VIP-Incentives.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">CLICK TO DOWNLOAD THE LIMITED-TIME VIP BROKER INCENTIVES WE ARE ELEGIBLE TO OFFER YOU </a>\r\n</p>', 'Thirty Six Zorra Condos', '', 'publish', 'closed', 'closed', '', 'thirty-six-zorra-condos-in-etobicoke', '', '', '2019-12-16 17:44:05', '2019-12-16 17:44:05', '', 0, 'http://hercastle.ca/?post_type=projects&#038;p=346', 0, 'projects', '', 0),
