(455, 1, '2019-12-16 17:22:08', '2019-12-16 17:22:08', '<p><strong>AN AMAZING OPPORTUNITY TO OWN A PIECE OF YORKVILLE</strong>\r\n\r\nThe developers are keeping many details of the 11 YV Condos under wraps while plans for the project are finalized. However, a few key details have been confirmed.\r\n\r\nFirst, the site\'s mixed-use functionality is expected to include ground-floor retail space that will house at least one prestige tenant. In addition, office suites will be mixed with luxurious residential condominiums in the project\'s upper floors. The total number of units and the height of the building have yet to be revealed, but current proposals indicate that a high-rise main tower will form the centerpiece of the 11 Yorkville Condos community. Reports suggest this high-rise could be as tall as 60 storeys.\r\n\r\nWith Yorkville boasting some of the most exclusive residential and commercial properties in all of Toronto, it\'s fair to expect that 11 Yorkville Condos will feature modern luxury at its finest. Floorplans and a price list are expected to be released in the coming months, so be sure to register early for immediate access to these materials once they are authorized for public distribution.\r\n\r\nTriple-A Location — Yorkville neighbourhood in Downtown Toronto best known for world-class feel and over the top luxury. Excellent shops, top boutiques, world-renowned brands, bistros, lodgings, fine accumulation of culture and social scene.\r\n\r\n\r\n\r\n<strong>Amenities</strong>\r\nBar, Catering Kitchen, Concierge and Porter Service , Fitness Studio , Guest Suites, Hot Tub, TV Lounge, Piano Lounge, Bordeaux Lounge , Movie Theatre, Business Centre, Outdoor Zen Water Feature, Outdoor lounge area with BBQ, Fireplace, Party Room, Pet Spa , Sophisticated Indoor-Outdoor Infinity Pool , Sauna, Men\'s and Women\'s Spa with Hammam steam rooms\r\n\r\n\r\n\r\n<strong><em>Register here or reply to this email for more information about the pricing and limited time incentives to own at this prime gta location!</em></strong>\r\n</p>\r\n\r\n<p>\r\n<a href=\"http://hercastle.ca/wp-content/uploads/2019/12/3.-11YV-floor-plans.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">CLICK TO DOWNLOAD THE FLOORPLANS </a>\r\n<a href=\"http://hercastle.ca/wp-content/uploads/2019/12/2.-11YV_Incentives-sheet.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">CLICK TO DOWNLOAD 11YV_Incentives sheet </a>\r\n<a href=\"http://hercastle.ca/wp-content/uploads/2019/12/1.-11YV_Brochure.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">CLICK TO DOWNLOAD 11YV_Brochure </a>\r\n\r\n</p>', '11 York Ville', '', 'publish', 'closed', 'closed', '', '11-york-ville', '', '', '2019-12-16 17:34:24', '2019-12-16 17:34:24', '', 0, 'http://hercastle.ca/?post_type=projects&#038;p=455', 0, 'projects', '', 0),
